import React from 'react';

const Rank=({rank})=>{
  return (<div className='pa2 dib'>
    <div className='f3 white'>{`Yor Rank Is ...${rank}`}</div>
    <div className='f2 white'>{`#4`}</div>
  </div>);
}
export default Rank;
